window.bookSummaryJSON = "<p>Cora Goode has woken up in a fairytale world where she can understand what birds are saying, men ride horses and have fluffy feathers in their hats and furniture zigs, zags and whirls in miracles of construction.</p> <p>The problem is, she thinks she’s in a dream. Without realizing it, Cora does something that starts a centuries-old curse that will sweep the land if she gets captured by the evil Minerva.</p> <p>At this point, her dream becomes a nightmare.</p> <p>Luckily, hot guy, fantasyland Noctorno is there to save her from the clutches of Minerva.</p> <p>Unfortunately, hot guy, fantasyland Noctorno doesn’t like Cora all that much. He has his reasons, but no matter what our Cora does to try to convince him, he won’t be convinced.</p> <p>Cora needs Tor to keep her safe and guide her through this fantastical world all while she hopes one day to wake up in her not-so-great apartment in her not-so-great life in her world.</p> <p>The problem is, the more time she spends with the gorgeous warrior Tor, the faster she falls in love with him.</p>"; 
